import React, { Component } from 'react';

class AddTeam extends Component {
    render() {
        return (
          <form>
            <div class="field">
              <label>Team Name:</label>
              <input
                name="name"
                type="text"
                onChange={this.handleChange}
              />
            </div>
            <div class="field">
              <label>Founded:</label>
              <input
                name="founded"
                type="text"
                onChange={this.handleChange}
              />
            </div>
            <button>Add</button>
          </form>
        );
    }
}

export default AddTeam;
